import { Box, Button, Fab, Grid, TextField, Typography } from '@mui/material'
import React from 'react'

import CloseOutlinedIcon from '@mui/icons-material/CloseOutlined';
import { height, padding } from '@mui/system';
const Add_item = () => {
  return (
    <div>
      {/* WHOLE CONTAINER LOADS */}
      <Grid container spacing={2} style={{
        border:'2px solid red'
      }}>


        {/* Add Item */}
        <Grid container item xs={12} md={7}>
          <Typography variant='h3' marginY={2} marginLeft={2}> Add new item</Typography>
        </Grid>
        
        {/* Button container style */}
        <Grid container item xs={12} md={5}>
          
          {/* Button container para may margin na maayos */}
          <Grid
            container
            direction="row"
            justifyContent="flex-end"
            alignItems="center"
            marginRight={7}>
              
  
          </Grid>

        </Grid>

        {/* container inputs */}
        <Grid
        container
        justifyContent="center">

          <Grid

          container
          marginY={2}
          marginLeft={5}
          marginRight={2}
          direction="row"
          justifyContent="center"
          alignItems="center"
          style={{
            borderRadius:'5px',
            border: '2px solid black'
            
          }}>
      
            <Grid 
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            
 
            item 
            spacing={2}
            md={4}
            margin={2}
            style={{
              border:'3px solid brown',
              padding:'10px'
            }}
            
            >
            <Typography  variant='h5' > asdasdas </Typography>
    
    
    <TextField  label="Outlined" variant="outlined" />
              
            </Grid>
            
            <Grid item md={6}>
            <Button fullWidth>Save</Button>
            <Button fullWidth>Save</Button>
            <Button fullWidth>Save</Button>
            </Grid>

          
     

          </Grid>

          <Button variant='contained'  style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            marginRight: '16px',
            padding:10
          }}> create </Button>

            <Button variant='contained'  style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            padding:10
          }}> cancel </Button>

        </Grid>

        













      </Grid>
      
    </div>
  )
}

export default Add_item
